import React from "react";
import "./auth.css";

export const Auth = () => {
  return (
      <div className="auth">
          <div className="row">

              <div className="col s6 offset-s3 z-depth-1 inner" id="panell">
                  <h4 id="title">Login Form</h4>
                  <form>
                      <div className="input-field" id="username">
                          <i className="material-icons prefix">account_circle</i>
                          <input id="icon_username" type="text" className="validate"/>
                              <label htmlFor="icon_username">Username</label>
                      </div>
                      <div className="input-field" id="password">
                          <i className="material-icons prefix">lock_outline</i>
                          <input id="icon_password" type="password" className="validate"/>
                              <label htmlFor="icon_password">Password</label>
                      </div>
                      {/*<p>*/}
                      {/*    <input type="checkbox" id="remember"/>*/}
                      {/*    <label htmlFor="remember" id="checkbox">Remember me</label>*/}
                      {/*</p>*/}
                      {/*<a className="waves-effect waves-light btn" id="loginbtn">Login</a>*/}
                      <div className="xxx">



                          <button className="btn waves-effect waves-light" id="loginbtn" type="submit" name="action">Login
                              {/*<i className="material-icons right">send</i>*/}
                          </button>
                          <a href="#" className="a"><span className="create-account">Create new account</span></a>
                      </div>
                  </form>
              </div>
          </div>

      </div>
  )
};
